import React from 'react'
import { Route, Redirect } from 'react-router-dom';

import Leagues from './Leagues/Leagues';
import Teams from './Teams/Teams';
import TeamSchedule from './Teams/TeamSchedule/TeamSchedule';
import LeagueScheduleContainer from './Leagues/LeagueSchedule/LeagueScheduleContainer';

import leaguesData from '../data/league';
import leagueTeamsData from '../data/TeamsOfLeague149';
//import leagueScheduleData from '../data/EventsOfLeague177';
import teamScheduleData from '../data/EventsOfTeam2618';

//<Redirect from='/' to="/leagues"/>
export const Routes = (props) => { 
	return(
  		<div>
    		<Route path='/leagues' render={ () => <Leagues  store={props.store}/> }/>

    		<Route path='/leagueschedule/:league_id' render={ () => <LeagueScheduleContainer  store={props.store} />}/>
    		<Route path='/teams/:league_id' render={ () => <Teams period={props.store.period} search={props.store.search} dispatch={props.store.dispatch} Data={leagueTeamsData}/>}/>
    		<Route path='/teamschedule/:team_id' render={ () => <TeamSchedule period={props.store.period} search={props.store.search} dispatch={props.store.dispatch} Data={teamScheduleData}/>}/>
    	</div>)
}
